    - type: Paper
      content: >-
        [bold]Дата: 17.03.3025

        Стандартное космическое время (СКВ): 21:47[/bold] 


        Сегодня снова дерьмовый день. «Фронтир» — дыра на краю цивилизации, где законы пишутся стволами, а воздух пахнет перегоревшим антифризом и потом.  


        Утром подняли по тревоге — сканеры засекли неопознанный транспорт у док-узла. Оказалось, контрабандисты с Пояса Астероидов. Попытались протащить партию синтетического адреналина под видом медицинских грузов. Мы их быстро прижали, но один ублюдок успел выхватить импульсный пистолет. Чуть не прожег мне броню. В ответ я всадил в него три заряда из дробовика. Теперь доки придётся отмывать от кишок.  


        Командир сказал, что это уже третья попытка прорыва за неделю. Видимо, кто-то распускает слухи, что у нас слабая охрана. Придётся устроить показательную экзекуцию следующей шайке.  


        Дата: 19.03.3025 

        СКВ: 00:12


        Дежурство в нижних ангарах. Темно, холодно, и везде этот противный гул реакторов. Вентиляция еле работает, дышать нечем.  


        Встретил старика Харка — техника, который служит здесь с момента постройки станции. Говорит, раньше «Фронтир-9» был передовым научным хабом, а теперь это просто перевалочный пункт для отбросов галактики.  


        Проверил оружие. Импульсная винтовка в норме, но магазины начали клинить — видимо, пыль забила. Завтра надо отнести оружейникам, если они снова не будут пьяные.  


        Дата: 21.03.3025

        СКВ: 15:33


        Сегодня был бунт в секторе D. Грузчики из местных решили, что им мало платят, и забаррикадировались в хранилище. Нас вызвали для «урегулирования».  


        Я ненавижу такую работу. Эти люди не враги, они просто отчаялись. Но приказы есть приказы. Вломились внутрь, применили шоковые гранаты. Двоих пришлось пристрелить — полезли с ножами. Остальные сдались.  


        После разбора полётов командир сказал, что корпорация прислала новый приказ — усилить контроль за персоналом. Видимо, скоро начнутся обыски и допросы.  


        Дата: 23.03.3025

        СКВ: 22:50 


        Сегодня поймали шпиона. Выдавал себя за инженера, но в базу не входил. Допрашивали в блоке C. Я стоял на страже.  


        Он не продержался и часа. Спецы из внутренней безопасности знают своё дело. Перед тем как отключиться, он пробормотал что-то про «Чёрный Флот».  


        Если это правда и они снова активизировались — нам всем пиздец.  


        Дата: 25.03.3025

        СКВ: 18:20


        Сегодня получил письмо с Земли. Сестра пишет, что у неё родился ребёнок. Я даже забыл, что она беременна.  


        Интересно, увижу ли я его когда-нибудь. Контракт ещё на два года.  


        А станция гудит, как всегда. Завтра снова дозор.  


        [bolditalic]Конец записи, Элиот де Мицуки, Лейтенант второго ранга[/bolditalic]
